import React from 'react';

const styles = {
    footerStyle: {
        background: 'grey',
    },
    footingStyle: {
        fontSize: '100px',
    },
};

function Footer() {
    return (
        <footer style={styles.footerStyle} className="footer">
            <p>Social Icons Here</p>
        </footer>
    )
}

export default Footer;
